    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        video.src = videoSrc.hole
        // c.style.visibility = "hidden";
        video.play()


        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        console.log(video.currentTime.toFixed(1))
        this.currentTime()
    }


